subSection.paragraph:
Herein we demonstrate that the two taxa proposed within
Galaxiella pusilla
s.l. can be diagnosed from each other using morphological and meristic characters, supporting their status as distinct species, and describe as a new species the western lineage. Given that the original description (
Mack 1936
), referable to the eastern lineage, was based on a small number of specimens and subsequent revisions (
McDowall 1978 a
;
McDowall & Frankenberg 1981
) were also based on a small number of specimens ( 15 for morphology, 8–48 for meristics), we also redescribe
Galaxiella pusilla (Mack)
. Habitat information for both lineages has also been incorporated into the species descriptions. The separation of this currently recognised threatened taxon into two distinct species with smaller geographic ranges has significant implications (
Coleman et al. 2010
;
Coleman et al. 2013
), and we discuss issues surrounding their conservation status and management.

Dorsal, anal, pectoral and pelvic fin segmented ray counts were separated into branched and unbranched categories, lower (including the raker in the angle of the arch) and upper limb gill raker counts were recorded separately, and the setback of the origin of the dorsal fin relative to the origin of the anal fin was also measured (see Raadik 
2014
). Unsegmented procurrent fin rays were excluded from fin ray counts.

In addition to TL and SL , 29 morphometric characters were measured in this study (
Fig. 1
). The definition of these characters follows Raadik ( 2014 ) except for GD (gape depth)—the distance between the tip of the lower jaw to the equidistant point between the posterior margins of the lower jaw, measured from ventral surface; KD (keel depth)—the maximum height of the keel; KL (keel length)—the length between the anterior and posterior extent of the keel, measured from the ventral surface; CL (caudal fin length)—standard length subtracted from total length and LCP (caudal peduncle length)—from the hypural crease, through the midline of the body, to the point above the posterior margin of anal fin base. The following 14 meristic characters were also enumerated: dorsal fin raysbranched (DRB), dorsal fin rays—total segmented (DRS), longest dorsal fin ray (LDR), anal fin rays—branched ( ARB ), anal fin rays—total segmented (ARS), longest anal fin ray (LAR), caudal fin rays—branched (CRB), caudal fin rays—total segmented (CRS), pectoral fin rays (PecR), pelvic fin rays (PelR), gill rakers lower limb (GRL), gill rakers upper limb (GRU), gill rakers total (GRT) and total number of vertebrae (Ver).

Landmark analyses. Landmarks are increasingly being used to characterize variation in body shape within and between fish populations (e.g.
Cavalcanti et al. 1999
;
Maderbacher et al. 2008
;
Chakrabarty et al. 2010
;
Ponton et al. 2013
). In the present study, the LHS of all fish specimens was photographed using a mounted Nikon D 70 digital SLR camera equipped with a 105mm macro lens with enhanced lighting against a white background. A ruler with 1 mm increments was included in each image for scale. Each specimen was positioned and photographed twice so that estimates of repeatability could be made. The ( X , Y ) coordinates of 12 landmarks on each image were digitised with TPSDIG version 2.17 (
Rohlf 2013 a
) (
Fig. 2
).

The 12 landmarks were selected to complement key morphometric characters (e.g. position of fins, length of fin bases, length and width of caudal peduncle, length of jaws, eye diameter), whilst representing precise locations to place points, such as the anterior and posterior insertion of fins, maximal extent of snout, jaws and eye. To adjust for the degree of curvature in fish specimens that can develop during preservation, the ‘unbend’ function in TPSUTIL version 1.58 (
Rohlf 2013 b
) was applied to all individuals (that fits a quadratic curve as a horizontal straight line, in this case, straightening was based on landmarks ‘ 1 ’, ‘*’ and ‘ 11 ’). Shape information was extracted by Procrustes superimposition (to standardise for specimen size, position and orientation) with MORPHOJ version 1.05 f (
Klingenberg 2011
). To determine the ability of body shape to discriminate between eastern and western regions based on Procrustes coordinates, covariance matrix calculations, principal component analysis (PCA), discriminant function analysis (DFA) and Procrustes ANOVA were performed with MORPHOJ. While PCA provides a visual representation of differences without specifying groups, DFA tests the reliability of discrimination between groups using the T -square statistic with significance assessed through a permutation test with 10,000 runs. Procrustes ANOVA was used to estimate landmarking error based on Goodall's F statistic ( F ) and the associated P - value was derived through comparing variation associated with coordinates generated from duplicate images.

Total length data collected in the field at various times of the year between
2007–2010
indicated that adult fish from the western region are significantly smaller than those from the eastern region ( ANOVA , females F = 151 , df = 1 , P -value < 0.001 ; males F = 201.7 , df = 1 , P -value < 0.001 ;
Fig. 5
). Pairwise comparisons between size-adjusted quantitative data indicated that characters HD and HW ( r = 0.78 in females), and HD and GW ( r = 0.72 in males and 0.75 in females) were highly correlated. Accordingly HD was removed from further analyses, as were GRL and GRU, which were highly correlated with GRT (GRL r s = 0.88 in eastern populations and 0.78 in western populations, GRU r s = 0.74 in eastern populations).

Eastern and western regions could also be discriminated based on the 12 landmarks and associated shape information, including taking into account measurement and placement error (females: Goodall’s F = 46.82 , P = < 0.001 and males: Goodall’s F = 39.92 , P = < 0.001 ). In the PCA results, separation between individuals was pronounced on PC 2 for both female and male specimens (
Fig. 7
). Distinguishing shape features associated with PC 2 included a more slender profile, more pronounced setback of the dorsal fin origin to anal fin and shorter prepelvic length for the eastern region compared to the western region. A DFA indicated a significant difference between eastern and western populations based on the Procrustes coordinates (females: T -square = 271.374 , P = < 0.001 ; and males: T -square = 229.286 , P = < 0.001 ) (
Fig. 8
). Correct classification of eastern and western females was high at 89.3 % and 88.5 %, respectively. Similarly, correct classification of eastern and western males was 91.0 and 90.3 %, respectively.

