subSection.paragraph:
Etymology. Pronounced “Too-urt Koo-urt” (or Tu-urt Ku-urt), from the Australian indigenous language groups Tjapwurrung, Korn Kopan noot, and Peekwurrung, meaning ‘little fish in freshwater’. Recommended standard name as ‘Little galaxias’ based on it being the smallest species in the Galaxiidae (e.g.
McDowall &Waters 2004
) and consistency with ‘little’ in the indigenous language meaning.

General biology. Non-migratory, freshwater species, that is occasionally found in inland slightly saline waters. The spawning period is possibly during late autumn to spring, but may be variable (
Beck 1985
;
Romanowski 2004
) and although some individuals may overlap breeding seasons, are thought to be predominantly a semelparous species, living one year and dying soon after spawning (
Romanowski 2004
). Where present, it can occur in high densities, although there may be substantial seasonal and inter-annual variability in population abundances (
Romanowski 2004 ; Coleman et al. in review
). It has developed adaptations to surviving extended seasonal periods of habitat drying, aided via a capacity for air-breathing and the use of moisture retaining habitat features such as vegetation cover and crayfish burrows (
Beck 1985
;
Romanowski 2004
; Coleman et al. in review). It is likely to exist within a metapopulation structure or a ‘population of sub-populations’, where persistence of the population as a whole is facilitated by multiple interconnected sub-populations ( viz.
Levins 1969
;
Hanski 1998
). Natural wetting and drying cycles typical of their habitats (and other environmental factors) can lead to large fluctuations in inter-annual population densities, emphasising the importance of habitat inter-connectivity across the landscape to maintain a balance between local population extinctions and recolonization (Coleman et al. in review). Wetting and drying cycles are also likely to be important for enhancing food resources and reducing competition and predation pressures (Coleman et al. in review).

