Habitat. Generally found in swamps, wetlands, shallow lakes, billabongs, small creeks and artificial earthen drains (
Fig. 13
) at very low elevation (mean 54 m above sea level, typically 25–72 m above sea level). Habitats are mostly shallow (mean maximum depth 1.1 m , typically 0.5–1.5 m ), with still to low water velocities (or often backwaters in faster flowing conditions) and substantial shading (mean 36 %, typically 10–60 % surface cover). The substratum composition tends to be dominated by fine clay (mean 33 %, typically 10–50 %) and silt (mean 43 %, typically 30–50 %) and occasionally coarser (particularly sand) with deposits of coarse particulate organic matter (mean 31 %, typically 10–60 % cover). Frequently captured where the vegetation cover is dense and consists primarily of emergent (mean 45 %, typically 24–73 % cover) and submerged (mean 12 %, typically 0–13 % cover) aquatic species. Measurements of water quality at the time of collection suggest that this species can withstand a broad range of conditions, at least, water temperatures of 5.8–24.8 o C, dissolved oxygen levels of 18–130 % saturation and turbidity between 1–133 NTU. The range for pH measurements was 5.0– 7.8 and the range for water electrical conductivity was 36–3,070 µS/cm.

General Biology. A non-migratory, freshwater species, occasionally found in inland slightly saline waters. The observed spawning period is between late autumn to spring and can be variable (
Backhouse & Vanner 1978
;
Humphries 1986
; Coleman et al. in review). It is predominantly an annual species that dies soon after spawning (
Massola 1938
;
Humphries 1986
;
Pen et al. 1993
;
Romanowski 2004
; Coleman et al. in review). Where present, it can occur in high densities, although there may be substantial seasonal and inter-annual variability in population abundances (Coleman et al. in review). It has developed adaptations to surviving extended periods of habitat drying, aided via a capacity for air-breathing and the use of moisture retaining habitat features such as vegetation cover and crayfish burrows (Coleman et al. in review). It is likely to exist with a metapopulation structure or a ‘population of sub-populations’, where persistence of the population as a whole is facilitated by multiple interconnected sub-populations ( viz.
Levins 1969
;
Hanski 1998
). Natural wetting and drying cycles typical of their habitats (and other environmental factors) can lead to large fluctuations in inter-annual population densities, emphasising the importance of habitat inter-connectivity across the landscape to maintain a balance between local population extinctions and recolonization (Coleman et al. in review). Wetting and drying cycles are also likely to be important for enhancing food resources and reducing competition and predation pressures (Coleman et al. in review).

From a conservation perspective, the formal recognition of
Galaxiella pusilla
and
G. toourtkoourt
as distinct taxa will enable independent management strategies to be tailored to account for their uniqueness and potential ecological differences, and is expected to lead to more successful outcomes for both species. For example,
G. pusilla
s.s. have much lower genetic diversity (
Coleman et al. 2010
;
Coleman et al. 2013
), are under substantial threat from habitat loss and habitat isolation from rapidly expanding urban areas in near Melbourne, and multiple surveys in
2008 and 2009
in northwest Tasmania and Flinders Island suggest that populations in these areas have dramatically contracted (
Coleman et al. 2010
;
Coleman et al. 2013
). Historical decline in distribution and area of occupancy is also indicated by a record of this species ( NMV A. 8330 ) from Scotchmans Creek in Yarra River catchment, Victoria, an area where extensive wetlands existed prior to urbanisation (e.g.
Burns 1984
;
Presland 1994
;
Lacey 2004
;
Otto 2005
).
